import * as React from 'react';
import {Link} from "react-router-dom";
import mainPic from "../Images/mainPic.jpg";
import Folder from "../MenuIcons/FolderSimple.svg";
import Arrow from "../MenuIcons/CaretRight.svg";
import GridIcon from "../Images/View grid.svg";
import listIcon from "../Images/View list.svg";
import './particularpage.css'



export function ParticularPage() {

    const menuElements = [
        {
            icon:Folder,
            title: 'Films',
            path: '/films',
            arrow:Arrow,
        },
        {
            icon:Folder,
            title: 'People',
            path: '/people',
            arrow:Arrow,
        },
        {
            icon:Folder,
            title: 'Planets',
            path: '/planets',
            arrow:Arrow,
        }
        ,
        {
            icon:Folder,
            title: 'Species',
            path: '/species'
            ,
            arrow:Arrow,
        }
        ,
        {
            icon:Folder,
            title: 'Starships',
            path: '/starships',
            arrow:Arrow,

        }
        ,
        {
            icon:Folder,
            title: 'Vehicles',
            path: '/vehicles',
            arrow:Arrow,
        }

    ];

    return (
        <div className="">
            <div  className={`text-white  flex item-center relative cursor-pointer duration-300  rounded-md  mb-3 `}>

                <span className={`pt-1 text-gray-800`}><img src={Folder}/></span>
                <span className={` font-medium ml-2  duration-300 flex-1 `}>Films</span>
                <span className={`absolute  duration-300 right-10 pt-1 dotIcon`} ><img src={GridIcon}/></span>
                <span className={`absolute  duration-300 right-3 pt-1 dotIcon`} ><img src={listIcon}/></span>
            </div>
            <div className="row">
                {/* Render a Card component for each movie */}
                {menuElements.map((element, index) => (

                    <div className="col-lg-4 col-md-6 mb-4">
                        <div className="card DataCard">
                            <img src={mainPic} className="card-img-top dataImg " alt="..." width={10} height={10}/>
                            <div className="card-body DataCardBody">
                                <div  className={`text-white  flex item-center relative cursor-pointer duration-300  rounded-md  `}>

                                    <span className={`pt-1 text-gray-800`}><img src={Folder}/></span>
                                    <span className={` font-medium ml-2  duration-300 flex-1 `}>{element.title}</span>
                                    <span className={`absolute  duration-300 right-3 pt-1 dotIcon`} ><img src={Arrow}/></span>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}
